import HeaderPage from './HeaderPage';
import model3back from './teslaimg/model-y_R1@2.jfif'
const Model3 = () => {
    return ( 
        <div>
      <HeaderPage
         title="Model 3"
         background={model3back}
         description="Hyper"
         range="450km"
         time="3.1s"
         speed="2"
         horsepower="1,100hp"
         first
      />
      <div className="models_container">
      </div>
      </div> 
    );
}
 
export default Model3;
